import React from "react"
import './login.css'
import { Link } from "react-router-dom";
import { useGoogleLogin } from '@react-oauth/google';
import { useNavigate } from "react-router-dom";
import { createClient } from "@supabase/supabase-js";
import { Auth, ThemeSupa } from "@supabase/auth-ui-react";

const supabase = createClient(
    "https://fkkbobhpegfhfsvbhcid.supabase.co",
    "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImZra2JvYmhwZWdmaGZzdmJoY2lkIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MTgzNjAzOTAsImV4cCI6MjAzMzkzNjM5MH0.0g1YrLe4lF9HJUKHEuh5_toW_5f_k2C2g7dEMrpU3dQsecret api: eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9."
);



function Login(){

    supabase.auth.onAuthStateChange(async (event) =>{
        if(event!== "SIGNED OUT"){
            navigate("/app1")
        }else{
            navigate("/")
        }
    })

    const login = useGoogleLogin({
        onSuccess: tokenResponse => {
            console.log(tokenResponse);
            navigate("/app1"); // Navigate to /app1 upon successful login
        },
    });

    React.useEffect(() => {
        const signupButton = document.querySelector('.img__btn');
        const container = document.querySelector('.cont');
        
        const toggleSignupClass = () => {
            container.classList.toggle('s--signup');
        };

        if (signupButton) {
            signupButton.addEventListener('click', toggleSignupClass);
        }

        // Cleanup event listener on component unmount
        return () => {
            if (signupButton) {
                signupButton.removeEventListener('click', toggleSignupClass);
            }
        };
    }, []);

    return(
        <div className="cont">
        <div className="form sign-in">
            <h2>Welcome !</h2>
            <label>
                <span>Email</span>
                <input type="email" />
            </label>
            <label>
                <span>Password</span>
                <input type="password" />
            </label>
            <p className="forgot-pass">Forgot password?</p>
            <Link to="/app" className="signin-link">
            <button type="button" className="submit" >
            Sign In
            </button>
            </Link> 
            <p className="OR">-------------OR-------------</p>
            <button className="submit-google" onClick={() => login()} >
            Sign in with Google ðŸš€
            </button>
            <Auth supabaseClient={supabase} providers={["google"]} />
        </div>

        <div className="sub-cont">
            <div className="img">
                <div className="img__text m--up">
                    <h2>Don't have an account? </h2>
                    <h2> Please Sign up!</h2>
                </div>
                <div className="img__text m--in">
                
                    <h2>If you already has an account, </h2>
                    <h2> just sign in.</h2>
                </div>
                <div className="img__btn">
                    <span className="m--up">Sign Up</span>
                    <span className="m--in"> <button>Sign In</button></span>
                </div>
            </div>
            <div className="form sign-up">
                <h2>Create your Account</h2>
                <label>                
                    <span>Name</span>
                    <input type="text" />
                </label>
                <label>                
                    <span>Email</span>
                    <input type="email" />
                </label>
                <label>
                    <span>Password</span>
                    <input type="password" />
                </label>
                <button type="button" className="submit">Sign Up</button>
                
            </div>
        </div>
    </div>
    )
} 

export default Login;
